import React from 'react';
import { View, Text, ScrollView, StyleSheet } from 'react-native';
import { persons } from "../Application/Trylists";

const Persons = () => {
    return (
        <View style={stylesContainers.container}>
            <Text style={stylesContainers.title}>Persons</Text>
            <ScrollView style={stylesContainers.scrollContainer}>
                {persons.map((person, index) => (
                    <View key={index} style={stylesContainers.personItem}>
                        <Text style={stylesContainers.personText}>
                            {person.firstName} {person.lastName}
                        </Text>
                    </View>
                ))}
            </ScrollView>
        </View>
    );
};

const stylesContainers = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        padding: 20,
    },
    title: {
        fontSize: 24,
        fontWeight: 'bold',
        marginBottom: 20,
    },
    scrollContainer: {
        width: '100%',
    },
    personItem: {
        padding: 10,
        borderBottomWidth: 1,
        borderBottomColor: '#ccc',
    },
    personText: {
        fontSize: 18,
    },
});

export default Persons;
